import React, { Component } from 'react';
import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link
} from "react-router-dom";
import { Grid } from '@material-ui/core';
import './styles.css';



const NavBar = () => {



	return (
		<div className="navbar">
			<Grid container direction="column" spacing={1}>
				<Grid item xs={2}>
				<Link className=" nav About" to="/about"><p className='nav-text-vertical'> <span className="about-link"> About </span></p></Link>
				</Grid>
				<Grid item xs={2}>
				<Link className=" nav Portfolio" to="/projects"><p className='nav-text-vertical'><span className="projects-link">Projects</span></p></Link>
				</Grid>
				<Grid item xs={2}>
				<Link className=" nav Passion" to="/passion"><p className='nav-text-vertical'>Passion</p></Link>
				</Grid>
				<Grid item xs={2}>
				<Link className=" nav Passion" to="/cv"><p className='nav-text-vertical'>CV </p></Link>
				</Grid>
			</Grid>
		</div>
	);
}

export default NavBar;
